/*    1.	Add these methods to the Complex structure: add, mult., divide.*/// Structures#include <stdio.h>#include <string.h>#include <math.h>typedef struct {    double re;    double im;}Complex;double modulus (Complex c);double add(Complex c);double multiply(Complex c);double divide(Complex c);int main(){    Complex z1;    Complex z2;    Complex *zptr;    z1.re = 1.0;    z1.im = 1.0;    printf("\nz1.re = %f\tz1.im = %f\n",z1.re,z1.im);    printf("The length of z1 is %f \n", modulus(z1));//I'm confused    printf("The sum of z1.re and z1.im is %f \n", add(z1));    printf("The product of z1.re and z1.im is %f \n", multiply(z1));    printf("The quotient of z1.re and z1.im is %f \n\n", divide(z1));    zptr = &z2;    zptr->re = 3.0;    zptr->im = 4.0;    printf("z2.re = %f\tz2.im = %f\n",z2.re,z2.im);    printf("The length of z2 is %f \n", modulus(z2));//I'm confused    printf("The sum of z2.re and z2.im is %f \n", add(z2));    printf("The product of z2.re and z2.im is %f \n", multiply(z2));    printf("The quotient of z2.re and z2.im is %f \n\n", divide(z2));}double modulus (Complex c) {    double x = c.re;    double y = c.im;    return sqrt(x*x + y*y);}double add(Complex c){    double x = c.re;    double y = c.im;    return x+y;}double multiply(Complex c){    double x = c.re;    double y = c.im;    return x*y;}double divide(Complex c){    double x = c.re;    double y = c.im;    return x/y;}